import style from "./About.module.css"

const About = () => {
    return(
        <div className={style.divAbout}>
            <h1>Me llamo Nicolás y soy hincha del club más grande de Córdoba.</h1>
            <h2>Club Atlético Talleres</h2>
        </div>
    )
}

export default About
